import Home from './components/routes/home/home.component';
import { Routes,Route} from "react-router-dom";


const Navigation = () => {
  return (
    <div>
      <div>
        <h1>I am the navigation bar</h1>
      </div>
    </div>
  )
}


const App = () => {
  return (
    <Routes>
      <Route path='/' element={<Home />}/>
    </Routes>
  )
};

export default App;
